import axios from 'axios';
import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux';
import { useParams } from 'react-router-dom'
import { testError, testLoading, testSuccess } from '../../redux/student/Actions';
import Studentnavbar from './Studentnavbar'

const Tests = () => {
  let course=useParams();
  const dispatch=useDispatch();
  let {testlist}=useSelector(state=>state.student.tests);

  let getTest=()=>{
  dispatch(testLoading());
    axios({
      method:"post",
      url:"http://localhost:8000/courseapi/getassignedtest/",
      data:{
        Course:course.id
      }
    }).then((res)=>{
      dispatch(testSuccess(res.data.data));
    }).catch((err)=>{
      dispatch(testError());
    })
  }
  useEffect(()=>{
    getTest();
  },[])
  return (<>
    <Studentnavbar/>
    {testlist ?(<>
    {testlist.map((ele)=>(<>
      <div style={{textAlign:"center",marginTop:"2vw"}}>
    <button style={{backgroundColor:"white",fontSize:"1vw"}}>{ele.Test_name}</button>
    </div>
    </>))}
    </>):(<></>)}

</>)
}

export default Tests
